export default function PopupMessage(props) {
  return (
    <div className='popup-message'>
      <button
        onClick={props.onClose}
        className='popup__close-button'
        type='button'
      />
      <img className='popup-message__icon' src={props.icon} alt='icon' />
      <p className='popup-message__message'>{props.message}</p>
    </div>
  );
}
